import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import ClubsDropdown from './dropdown/clubsDropdown';
import EventsDropdown from './dropdown/eventsDropdown';
import ProfileDropdown from './dropdown/profileDropdown';
import logo from './images/logo.png';
import './Navbar.css';

function Navbar() {
  const [showNavbar, setShowNavbar] = useState(false);
  const toggleNavbar = () => {
    setShowNavbar(!showNavbar);
  };

  return (
    <div className="navbar-container">
      <Link to="/">
        <img src={logo} alt="Logo" className="navbar-logo" />
      </Link>
      <div className="navbar-links">
        <div className={`navbar ${showNavbar ? 'show' : ''}`}>
          <ul>
            <li className="navbar-item">
              <Link to="/" className="nav-link">
                Home
              </Link>
            </li>
            <li className="navbar-item dropdown">
              <ClubsDropdown />
            </li>
            <li className="navbar-item dropdown">
              <EventsDropdown />
            </li>
            <li className="navbar-item">
              <Link to="/watch" className="nav-link">
                Watch
              </Link>
            </li>
            <li className="navbar-item dropdown profile-dropdown">
              <ProfileDropdown />
            </li>
          </ul>
        </div>
        <div className="navbar-toggle" onClick={toggleNavbar}>
          <span className="navbar-toggle-icon"></span>
        </div>
      </div>
    </div>
  );
}

export default Navbar;
